import "../App.css";

const Body = () => {
    return(
    <div>
        <label for="pet-select">Choose a pet:</label>


        <select name="pets" id="pet-select" autoFocus="true">
            <option value="dog">Dog</option>
            <option value="cat">Cat</option>
        </select>
    </div>
    );
}

export default Body;
